     cambios(miElement, data[i].fields.nombre);

    }

error : function(xhr, status) {

 });


function cambios(ex, n){
    var mi = ex
    var nu = n
    console.info(ex+n)
    mi.onclick = function(){
        ur = n
        var url = '/reportando/'+ur
        document.location = url;
    }
    }
